&quot;American Pop&quot; is the animated story of a very talented and troubled family starting with 19th century Russia and moving through several generations of musicians. The film covers American music from the pre-jazz age through soul, '50s rock, drug-laden psychadelia, and punk, finally ending with the onset of new wave in the early 1980s.
